    public function getSourceContext()
    {
        return new Source("{% extends \"_fullbase.html.twig\" %}

{% block body %}
\t<div class=\"main\">
\t\t{% block header %}
\t\t\t<div class=\"header\">
\t\t\t\t<h1>
\t\t\t\t\t{{ program.title }}
\t\t\t\t</h1>
\t\t\t\t<h2>Ajout d'une nouvelle saison</h2>
\t\t\t\t<hr/>
\t\t\t</div>
\t\t{% endblock %}
\t\t{{ form_start(form) }}

\t\t{# Number of the season #}
\t\t{{ form_label(form.number, 'Numéro de saison *') }}
\t\t<div class=\"input-group mb-3\">
\t\t\t{{ form_widget(form.number, { 'attr': {'class' : 'form-control'}}) }}
\t\t</div>
\t\t<span class=\"message_error\">{{ form_errors(form.number)}}</span>
\t\t{{ form_help(form.number) }}

\t\t{# Description #}
\t\t{{ form_label(form.description, 'Description ') }}
\t\t<div class=\"input-group mb-3\">
\t\t\t{{ form_widget(form.description, {'attr': {'class' : 'form-control'}}) }}
\t\t</div>
\t\t<span class=\"message_error\">{{ form_errors(form.description)}}</span>
\t\t{{ form_help(form.description) }}

\t\t{# Year #}
\t\t{{ form_label(form.year, 'Année de sortie') }}
\t\t<div class=\"input-group mb-3\">
\t\t\t{{ form_widget(form.year, {'attr': {'class' : 'form-control'}}) }}
\t\t</div>
\t\t<span class=\"message_error\">{{ form_errors(form.year)}}</span>
\t\t{{ form_help(form.year) }}

\t\t{# Hidden program field #}
\t\t{% do form.program.setRendered() %}

\t\t<button type=\"submit\" class=\"btn btn-dark mb-2\">Créer la nouvelle saison</button>
\t\t{{ form_end(form) }}
\t</div>
{% endblock %}
